Properties.Header:
{% assign isForServeDay = Workflow | Attribute:'ForServeDay' | AsBoolean %}

{% if isForServeDay %}
        {{ 'Global' | Attribute:'ProjectFormServeDayLanguage' }}
{% else %}
    <div class="alert alert-info">
        Project Finder is a way for you to get volunteers to help with a project!
        <br><br>
        Once you submit the form it will go through an approval process. Once approved, your project will be posted to Northside Christian Church's website. The person you choose as your Team Leader will be in charge of all communication to the volunteers who sign up for your project. Please give as much detail as possible.
        <br><br>
        Thanks for participating!
    </div>
{% endif %}

