{% capture singleSelectOutput %}
    {%- definedvalue where:'IsActive == true' expression:'DefinedTypeId == 184 || DefinedTypeId == 132' sort:'Value' -%}
        {%- for org in definedvalueItems -%}
                {%- if forloop.first -%}
                    {{- '0^Other/Not Listed' -}}
                {%- endif -%}
                {% assign toShow = org | Attribute:'ShowOnProjectFinder','RawValue' %}
                {%- unless toShow == 'False'  -%}
                    ,{{- org.Id -}}^{{- org.Value -}} 
                {% endunless %}
        {%- endfor -%}
    {%- enddefinedvalue -%}
{% endcapture %}

{{ singleSelectOutput }}

{% assign characteristics = 183 | FromCache:'DefinedType' | Property:'DefinedValues' | Where:'IsActive',true | OrderBy:'Value' %}

{%- capture singleSelectOutput -%}
    {%- for characteristic in characteristics -%}
        {% if characteristic.Id == 3138 %}
            {% continue %}
        {% else %}
            {%- unless forloop.first -%},{%- endunless -%}
            {{- characteristic.Id -}}^{{- characteristic.Value -}}
        {% endif %}
    {%- endfor -%} 
{%- endcapture -%}

